  if (unsavedChangesExist()) {
    event.preventDefault();
    event.returnValue = 'You have unsaved changes. Are you sure you want to leave the page?';
  }
});

const main = ReactDOM.createRoot(document.getElementById('root'));
main.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
)

